(154, 1, '2020-12-02 21:26:39', '2020-12-02 21:26:39', '<div class=\"detailmodule_html\"><div class=\"detail-desc-decorate-richtext\"><div style=\"text-align: center\">\n	<span><strong><span style=\"font-size: 36px\">Ayudante de cocina</span></strong></span>\n</div>\n<div style=\"text-align: center\">\n	<span style=\"font-size: 22px\">Esta rebanadora porttil est hecha de acero inoxidable de calidad alimentaria y plstico ABS sin BPA,</span>\n</div>\n<div style=\"text-align: center\">\n	<span style=\"font-size: 22px\">Que puede cortar fcilmente varias verduras,</span>\n</div>\n<div style=\"text-align: center\">\n	<span style=\"font-size: 22px\">Quesos y frutas</span>\n</div>\n<div style=\"text-align: center\">\n	&nbsp;\n</div>\n<div style=\"text-align: center\">\n	<span style=\"font-size: 22px\">Incluso se puede hacer en una pasta de verduras o pur de patatas</span>\n</div>\n<div style=\"text-align: center\">\n	<strong><span style=\"font-size: 28px\"><span>Ahorra tiempo y procesa la comida de manera eficiente</span></span></strong>\n</div>\n<div style=\"text-align: center\">\n	&nbsp;\n</div>\n<p style=\"text-align: center\">\n	<img alt=\"H7fbee0eb61b84d8da55e850a42686aadX\" src=\"https://ae01.alicdn.com/kf/H98ed3e14cdca47128e4168d200f9be94b.jpg\" />\n</p>\n</div></div>\r\n<div class=\"detailmodule_html\"><div class=\"detail-desc-decorate-richtext\"><div style=\"text-align: center\">\n	<strong><span style=\"font-size: 28px\">Hacer cocinar fcil<img alt=\"Z_02\" src=\"https://ae01.alicdn.com/kf/H928ad387c0b34eae884c86f2cb4622e2J.jpg\" /></span></strong>\n</div>\n<div style=\"text-align: center\">\n	<strong><span style=\"font-size: 28px\"><img alt=\"6\" src=\"https://ae01.alicdn.com/kf/Hf140b41d8caa4f8c9fd6f9554729aa2f0.jpg\" /><img alt=\"7\" src=\"https://ae01.alicdn.com/kf/H5eff76cc87d54152ab796db560d34486W.jpg\" /></span></strong>\n</div>\n<div style=\"text-align: center\">\n	<strong><span style=\"font-size: 28px\"></span></strong>\n</div>\n<div style=\"text-align: cen