(261, 1, '2019-03-06 08:23:20', '2019-03-06 08:23:20', '<h2>HUGE SALE UP TO 80% OFF</h2>\n<h4>DIAL UP THE GLAMOUR IN AN ELEGANT COCKTAIL DRESS</h4>\n<a href=\"#products\" role=\"button\">\nView collection\n</a>\n<h2>WE ARE ELEGANT</h2>\n<h2>Elegance isn\'t solely defined by what you wear. It\'s how you carry yourself.</h2>\n<h4>Beautiful products</h4>\nI never look at other people\'s work. My mind has to be completely focused on my own illusions. It\'s a philosophy of life. A practice with no end.\n<h4>Fast delivery</h4>\nIf you do this, something will change, what will change is that you will change, your life will change, and if you can change you, you can perhaps change the world.\n<h4>100% Satisfaction</h4>\nI\'ve always thought of the T-shirt as the Alpha and Omega of the fashion alphabet. I like the things around me to be beautiful and slightly dreamy.\n<h2>LATEST PRODUCTS</h2>\n[products limit=8 columns=4]\n<a href=\"https://demosites.io/shop/shop/\" role=\"button\">\nSee all products\n</a>\n<h2>Be inspired. Get ahead of trends.</h2>\n[products limit=4 columns=4 category=\'dresses\']', 'Home', '', 'publish', 'closed', 'closed', '', '3669a-home', '', '', '2020-12-05 16:36:07', '2020-12-05 16:36:07', '', 0, 'https://demosites.io/shop/?page_id=5', 0, 'page', '', 0),
