(282, 1, '2019-03-06 14:42:42', '2019-03-06 14:42:42', '<h1>About Us</h1>		\n		We are Shop. We are an empowering, bold and forward thinking online fashion brand, inspired by real life. We design and create product informed by you, our customers, our friends and global influences: Catwalk, celebrity, social media, bloggers and street style, creating an online fashion destination that encompasses and celebrates everything it means to be a girl in a digitally immersed world today.		\n			<h2>Meet our team</h2>		\n		<p>An awesome way to introduce the members of your team.</p>		\n			<figure><img width=\"263\" height=\"357\" src=\"https://ritxykun.com/Worpress/wordpress/wp-content/uploads/2019/07/daniel-monteiro-u8yJtV_9M9U-unsplash.jpg\" alt=\"\" srcset=\"https://ritxykun.com/Worpress/wordpress/wp-content/uploads/2019/07/daniel-monteiro-u8yJtV_9M9U-unsplash.jpg 263w, https://ritxykun.com/Worpress/wordpress/wp-content/uploads/2019/07/daniel-monteiro-u8yJtV_9M9U-unsplash-221x300.jpg 221w\" sizes=\"(max-width: 263px) 100vw, 263px\" /></figure>BObBY STONE<p>Director</p>		\n			<figure><img width=\"263\" height=\"357\" src=\"https://ritxykun.com/Worpress/wordpress/wp-content/uploads/2019/07/alex-perez-VLPLo-GtrIE-unsplash.jpg\" alt=\"\" srcset=\"https://ritxykun.com/Worpress/wordpress/wp-content/uploads/2019/07/alex-perez-VLPLo-GtrIE-unsplash.jpg 263w, https://ritxykun.com/Worpress/wordpress/wp-content/uploads/2019/07/alex-perez-VLPLo-GtrIE-unsplash-221x300.jpg 221w\" sizes=\"(max-width: 263px) 100vw, 263px\" /></figure>Maria Woods<p>Designer</p>		\n			<figure><img width=\"263\" height=\"357\" src=\"https://ritxykun.com/Worpress/wordpress/wp-content/uploads/2019/07/aldair-vargas-3JPxEsnwNrM-unsplash.jpg\" alt=\"\" srcset=\"https://ritxykun.com/Worpress/wordpress/wp-content/uploads/2019/07/aldair-vargas-3JPxEsnwNrM-unsplash.jpg 263w, https://ritxykun.com/Worpress/wordpress/wp-content/uploads/2019/07/aldair-vargas-3JPxEsnwNrM-unsplash-221x300.jpg 221w\" sizes=\"(max-width: 263px)