(302, 1, '2020-12-05 17:03:53', '0000-00-00 00:00:00', '<div class=\"detailmodule_dynamic\"></div>\r\n<div class=\"detailmodule_html\"><div class=\"detail-desc-decorate-richtext\"><div>\n	<span style=\"font-size: 20px\">Marca SeaKnight serie rapidi 6,2: 1 4,7: 1 anticorrosin 2000H 3000H 4000H 5000 6000 carrete de pesca de agua salada giratorio 11BB</span>\n</div>\n<div>\n	&nbsp;\n</div>\n<div>\n	&nbsp;\n</div>\n<div>\n	&nbsp;\n</div>\n<div>\n	<div>\n<div style=\"font-size: 13.3333px\">\n<span><strong><span style=\"font-family: verdana, geneva, sans-serif\"><span style=\"font-size: 14px\">Caractersticas:</span></span></strong></span>\n</div>\n<div style=\"font-size: 13.3333px\">\n<div>\n<span style=\"font-size: 16px\">1. Los rodamientos y componentes anticorrosivos permiten que el carrete se pueda utilizar tanto en agua dulce como en agua salada.</span>\n</div>\n<div>\n<span style=\"font-size: 16px\">2. 10 rodamientos de bolas inoxidables + 1 rodamiento de bolas inoxidable inverso que proporciona un funcionamiento suave.</span>\n</div>\n<div>\n<span style=\"font-size: 16px\">3. El diseo asimtrico actualizado del rotor puede lograr un funcionamiento ms ligero pero ms potente.</span>\n</div>\n<div>\n<span style=\"font-size: 16px\">4. Carrete de aluminio CNC superligero.</span>\n</div>\n<div>\n<span style=\"font-size: 16px\">5. El sistema de arrastre de fibra de carbono proporciona un rendimiento de arrastre ms potente.</span>\n</div>\n</div>\n	</div>\n	<div>\n\n</div>\n	<div>\n<strong style=\"font-size: 12px\"><span style=\"font-family: verdana , geneva , sans-serif\"><span style=\"font-size: 14.0px\">Lista de paquetes:</span></span></strong>\n	</div>\n	<div>\n<span style=\"font-family: verdana , geneva , sans-serif\"><span style=\"font-size: 14.0px\">1 carrete de pesca;</span></span>\n	</div>\n	<div>\n<span style=\"font-family: verdana , geneva , sans-serif\"><span style=\"font-size: 14.0px\">1 unidad * instrucciones;</span></span>\n	</div>\n	<div>\n<span style=\"font-family: verdana , geneva , sans-serif\"><span style=\"font-size: 14.0px\">1 ud. * bolsa de carrete;</span></span>\n	</div>\n	<div>\n<span style=\"font-family: verdana , geneva , sans-serif\"><span style=\"font-size: 14.0px\">Embalaje Original de la Caja</span></span>\n	</div>\n	<div>\n\n</div>\n	<div>\n<strong><span style=\"font-family: verdana, geneva, sans-serif\"><span style=\"font-size: 14px\">Detalles del producto:</span></span></strong>\n	</div>\n	<div>\n<span style=\"font-size: 16px\">RAPIDII2000H | Peso: 240g | Relacin de engranajes: 6,2: 1 | Rodamiento de bolas: 11BB | Arrastre mximo: 6 kg | Capacidad lineal (mm-M): 0,16-205/0,20-130/0,23-100</span>\n	</div>\n	<div>\n<span style=\"font-size: 16px\">RAPIDII2500H | Peso: 237g | Relacin de engranajes: 6,2: 1 |</span><span style=\"font-size: 16px\">Bola</span><span style=\"font-size: 16px\">Rodamiento</span><span style=\"font-size: 16px\">: 11BB | Arrastre mximo: 6 kg | Capacidad lineal (mm-M): 0,20-295/0,23-220/0,26-170</span>\n	</div>\n	<div>\n<span style=\"font-size: 16px\">RAPIDII3000H | Peso: 243g | Relacin de engranajes: 6,2: 1 |</span><span style=\"font-size: 16px\">Bola</span><span style=\"font-size: 16px\">Rodamiento</span><span style=\"font-size: 16px\">: 11BB | Arrastre mximo: 6 kg | Capacidad lineal (mm-M): 0,23-275/0,26-215/0,29-170</span>\n	</div>\n	<div>\n<span style=\"font-size: 16px\">RAPIDII4000H | Peso: 254g | Relacin de engranajes: 6,2: 1 |</span><span style=\"font-size: 16px\">Bola</span><span style=\"font-size: 16px\">Rodamiento</span><span style=\"font-size: 16px\">: 11BB | Arrastre mximo: 8 kg | Capacidad lineal (mm-M): 0,26-325/0,29-260/0,32-210</span>\n	</div>\n	<div>\n<span style=\"font-size: 16px\">RAPIDII5000H | Peso: 266g | Relacin de engranajes: 6,2: 1 |</span><span style=\"font-size: 16px\">Bola</span><span style=\"font-size: 16px\">Rodamiento</span><span style=\"font-size: 16px\">: 11BB | Arrastre mximo: 8 kg | Capacidad lineal (mm-M): 0,29-305/0,32-250/0,37-185</span>\n	</div>\n	<div>\n<span style=\"font-size: 16px\">RAPIDII6000H | Peso: 380g | Relacin de engranajes: 6,2: 1 |</span><span style=\"font-size: 16px\">Bola</span><span style=\"font-size: 16px\">Rodamiento</span><span style=\"font-size: 16px\">: 11BB | Arrastre mximo: 10 kg | Capacidad lineal (mm-M): 0,35-325/0,40-250/0,45-195</span>\n	</div>\n	<div>\n\n</div>\n	<div>\n<span style=\"font-size: 14px;font-family: verdana, geneva, sans-serif\">Repuesto de detalles:</span>\n	</div>\n	<div style=\"font-size: 13.3333px\">\n<span style=\"font-family: verdana, geneva, sans-serif;font-size: 14px\">RAPID II 2000 | Peso: 48g | Capacidad de Lnea: 0,14-80 0,16-60</span>\n	</div>\n	<span style=\"font-family: verdana, geneva, sans-serif;font-size: 14px\">Rpido</span><span style=\"font-family: verdana, geneva, sans-serif;font-size: 14px\">II</span><span style=\"font-family: verdana, geneva, sans-serif;font-size: 14px\">2500 | Peso: 52g | Capacidad de Lnea: 0,16-110 0,20-70</span><br />\n	<span style=\"font-family: verdana, geneva, sans-serif;font-size: 14px\">Rpido</span><span style=\"font-family: verdana, geneva, sans-serif;font-size: 14px\">II</span><span style=\"font-family: verdana, geneva, sans-serif;font-size: 14px\">3000 | Peso: 55g | Capacidad de Lnea: 0,20-105 0,23-80</span>\n	<div style=\"font-size: 13.3333px\">\n\n</div>\n	<div style=\"font-size: 13.3333px\">\n<span style=\"font-size: 18px\"><span><span style=\"font-family: verdana, geneva, sans-serif\">Por favor nota:</span></span></span>\n	</div>\n	<div style=\"font-size: 13.3333px\">\n<span style=\"font-size: 18px\"><span><span style=\"font-family: verdana, geneva, sans-serif\">El carrete de repuesto no es gratis!</span></span></span>\n	</div>\n	<div style=\"font-size: 13.3333px\">\n<span style=\"font-size: 18px\"><span><span style=\"font-family: verdana, geneva, sans-serif\">Si necesita carrete de repuesto, elija la opcin de color \"carrete y carrete de repuesto\".</span></span></span>\n	</div>\n	<div>\n<span style=\"font-family: verdana , geneva , sans-serif\"><span style=\"font-size: 14.0px\"><img alt=\"3\" src=\"https://ae01.alicdn.com/kf/Hc80fc6d44eb24671a2723d5a7217d2019.png\" /></span></span>\n	</div>\n	<div>\n<span style=\"font-family: verdana , geneva , sans-serif\"><span style=\"font-size: 14.0px\"><img alt=\"st_01\" src=\"https://ae01.alicdn.com/kf/Ha7232da2571d4cf19ba4b2233bb3f0fcb.jpg\" /></span></span>\n	</div>\n	<div>\n\n</div>\n	<div>\n<img alt=\"RAPID-II_02\" src=\"https://ae01.alicdn.com/kf/H71f51bea581c492ca69a4f62e80f0401J.jpg\" /><img alt=\"RAPID-II_03\" src=\"https://ae01.alicdn.com/kf/H0aa36ad5f55a44009faca1ebf3b7adbeu.jpg\" /><img alt=\"RAPID-II_04\" src=\"https://ae01.alicdn.com/kf/H97e3805038ed40318726cf54d7b2fb40O.jpg\" />\n	</div>\n	<div>\n<img alt=\"white_04\" src=\"https://ae01.alicdn.com/kf/H50dd2cde58e54357bf9495c6ce89ebaf0.jpg\" />\n	</div>\n	<div>\n<img alt=\"RAPID-II_05\" src=\"https://ae01.alicdn.com/kf/Hbea12f695ba2409e9fd3f3cf3603404d0.jpg\" />\n	</div>\n	<div>\n<div style=\"font-size: 13.3333px;text-align: center\">\n<strong><span style=\"font-size: 20px\"><img alt=\"4\" src=\"https://ae01.alicdn.com/kf/H6e071c8c59b64f49adc73d9c7089ec51A.png\" />Relacin de velocidad alta y baja</span></strong>\n</div>\n<div style=\"font-size: 13.3333px;text-align: center\">\n<span style=\"font-size: 16px\">6,2: 1 2000/2500/3000/4000/5000 Series</span>\n</div>\n<div style=\"font-size: 13.3333px;text-align: center\">\n<span style=\"font-size: 16px\">4,7: 1 de la serie 6000</span>\n</div>\n<div style=\"font-size: 13.3333px;text-align: center\">\n<span style=\"font-size: 16px\">Los componentes anticorrosivos permiten que el carrete se pueda utilizar tanto en agua dulce como en agua salada.</span>\n</div>\n<div style=\"font-size: 13.3333px;text-align: center\">\n<span style=\"font-size: 16px\"><img alt=\"white_07\" src=\"https://ae01.alicdn.com/kf/H4909f648be364f66828b7a6a76d7d697z.jpg\" /></span>\n</div>\n<div style=\"font-size: 13.3333px;text-align: center\">\n<span style=\"font-size: 16px\"><img alt=\"white_13\" src=\"https://ae01.alicdn.com/kf/H06b4539565774359919bc2d1f0807872D.jpg\" /></span>\n</div>\n	</div>\n	<div>\n<div style=\"font-size: 13.3333px;text-align: center\">\n<strong><span style=\"font-size: 20px\">10 + 1 rodamientos de bolas inoxidables</span></strong>\n</div>\n<div style=\"font-size: 13.3333px;text-align: center\">\n<span style=\"font-size: 16px\">10 rodamientos de bolas de acero inoxidable + 1 rodamiento de bolas anti-reversa para una accin suave en la pesca.</span>\n</div>\n<div style=\"font-size: 13.3333px;text-align: center\">\n<span style=\"font-size: 16px\"><img alt=\"white_08\" src=\"https://ae01.alicdn.com/kf/H51a85033276942a68e47ba9f663041b9u.jpg\" /></span>\n</div>\n<div style=\"font-size: 13.3333px;text-align: center\">\n\n</div>\n	</div>\n	<div>\n<div style=\"font-size: 13.3333px;text-align: center\">\n<strong><span style=\"font-size: 20px\">Actualizado asimtrico Rotor diseo</span></strong>\n</div>\n<div style=\"font-size: 13.3333px;text-align: center\">\n<span style=\"font-size: 16px\">Al revisar el mtodo convencional de construccin simtrica del rotor, hacer que el brazo se espese en el rodillo de lnea, subir el par triangular para el lateral, para lograr un funcionamiento ms ligero pero ms potente.</span>\n</div>\n<div style=\"font-size: 13.3333px;text-align: center\">\n<span style=\"font-size: 22px\"><strong><span>Nota: talla 6000 excluida</span></strong></span>\n</div>\n<div style=\"font-size: 13.3333px;text-align: center\">\n<span style=\"font-size: 16px\"><img alt=\"white_10\" src=\"https://ae01.alicdn.com/kf/Hb8e0450899f244f7816e687b36632e4fX.jpg\" /></span>\n</div>\n	</div>\n	<div>\n<div style=\"font-size: 13.3333px;text-align: center\">\n<span style=\"font-size: 20px\"><strong>Triple Disco de arrastre</strong></span>\n</div>\n<div style=\"font-size: 13.3333px;text-align: center\">\n<span style=\"font-size: 16px\">3 discos de carbono + 3 arandelas de arrastre de acero inoxidable que proporcionan una potencia de arrastre de 22lbs.</span>\n</div>\n<div style=\"font-size: 13.3333px;text-align: center\">\n<span style=\"font-size: 16px\"><img alt=\"white_11\" src=\"https://ae01.alicdn.com/kf/H557079484af54615959af69aa66da560w.jpg\" /></span>\n</div>\n<div style=\"font-size: 13.3333px;text-align: center\">\n<strong style=\"font-size: 20px\">Mango plegable y perilla extrable</strong>\n</div>\n<div style=\"font-size: 13.3333px;text-align: center\">\n<span style=\"font-size: 16px\">Diseo de mango plegable para un fcil almacenamiento y perilla extrable para elegir y reparar personal.</span>\n</div>\n<div style=\"font-size: 13.3333px;text-align: center\">\n<span style=\"font-size: 16px\"><img alt=\"xq\" src=\"https://ae01.alicdn.com/kf/H3aad3e89251845a393e9c065183ed5c2W.jpg\" /></span>\n</div>\n<div style=\"font-size: 13.3333px;text-align: center\">\n<strong><span style=\"font-size: 20px\">Tecnologa ligera y elctrica para un peso ms ligero</span></strong>\n</div>\n<div style=\"font-size: 13.3333px;text-align: center\">\n<span style=\"font-size: 16px\">En comparacin con Rapid, Rapid II, al menos un 20% de peso reducido, puede lograr un funcionamiento ms flexible.</span>\n</div>\n<div style=\"font-size: 13.3333px;text-align: center\">\n<span style=\"font-size: 16px\">Carrete de aluminio CNC superligero.</span>\n</div>\n<div style=\"font-size: 13.3333px;text-align: center\">\n<span style=\"font-size: 16px\"><img alt=\"21\" src=\"https://ae01.alicdn.com/kf/H8857c3722a0b4ab8b5a8c0e44d063c29J.jpg\" /></span>\n</div>\n<div style=\"font-size: 13.3333px;text-align: center\">\n<strong style=\"font-size: 20px\">De aleacin de rodillo en lnea</strong>\n</div>\n<div style=\"font-size: 13.3333px;text-align: center\">\n<span style=\"font-size: 16px\">El rodillo de lnea de aleacin antigiro garantiza una excelente fundicin.</span>\n</div>\n<div style=\"font-size: 13.3333px;text-align: center\">\n<span style=\"font-size: 16px\"><img alt=\"white_16\" src=\"https://ae01.alicdn.com/kf/Hf90311dd9b3e4f3795083ac429dc8d11w.jpg\" /></span>\n</div>\n<div style=\"font-size: 13.3333px;text-align: center\">\n<strong style=\"font-size: 20px\">til la lnea K completos,</strong>\n</div>\n<div style=\"font-size: 13.3333px;text-align: center\">\n<span style=\"font-size: 16px\">Te ofrece una manera prctica de sujetar tu lnea</span>\n</div>\n<div style=\"font-size: 13.3333px;text-align: center\">\n<span style=\"font-size: 16px\"><img alt=\"black_13\" src=\"https://ae01.alicdn.com/kf/H03a64001a3c043e98a17d7e5fc31df6fR.jpg\" /></span>\n</div>\n	</div>\n	<div style=\"text-align: center\">\n<span style=\"font-size: 20px\"><strong>Paquete</strong></span>\n	</div>\n	<div>\n<img alt=\"white_17\" src=\"https://ae01.alicdn.com/kf/H99b37eba51364ab3a19656e496dce5f7v.jpg\" /><img alt=\"white_18\" src=\"https://ae01.alicdn.com/kf/H0e4a649259db48598d2b0a11ed7da0d8g.jpg\" /><img alt=\"white_19\" src=\"https://ae01.alicdn.com/kf/H518b19c187c940b3a34b618933a8abd7r.jpg\" />\n	</div>\n	<div>\n<img alt=\"FAQ-RAPID_03\" src=\"https://ae01.alicdn.com/kf/HTB19ZuPgzoIL1JjSZFyq6zFBpXa7.jpg?size=115052&amp;height=168&amp;width=960&amp;hash=70438d39d8b7cae6315652f6a2ba1465\" />\n	</div>\n</div>\n<div>\n	<div>\n<span style=\"font-size: 16.0px\"><span style=\"font-family: arial , helvetica , sans-serif\">RAPIDII serie</span></span>\n	</div>\n	<div>\n\n</div>\n	<div>\n<span style=\"font-size: 16.0px\"><span style=\"font-family: arial , helvetica , sans-serif\">Pregunta 1:</span></span>\n	</div>\n	<div>\n<span style=\"font-size: 16.0px\"><span style=\"font-family: arial , helvetica , sans-serif\">Se puede utilizar tanto en agua dulce como en agua salada?</span></span>\n	</div>\n	<div>\n<span style=\"font-size: 16.0px\"><span style=\"font-family: arial , helvetica , sans-serif\">Respuesta:</span></span>\n	</div>\n	<div>\n<span style=\"font-size: 16.0px\"><span style=\"font-family: arial , helvetica , sans-serif\">S, los rodamientos y componentes anticorrosivos permiten que el carrete se pueda utilizar tanto en agua dulce como en agua salada, pero debe limpiar y lubricar despus de usarlo.</span></span>\n	</div>\n	<div>\n\n</div>\n	<div>\n<span style=\"font-size: 16.0px\"><span style=\"font-family: arial , helvetica , sans-serif\">Pregunta 2:</span></span>\n	</div>\n	<div>\n<span style=\"font-size: 16.0px\"><span style=\"font-family: arial , helvetica , sans-serif\">Este carrete tiene 11 rodamientos?</span></span>\n	</div>\n	<div>\n<span style=\"font-size: 16.0px\"><span style=\"font-family: arial , helvetica , sans-serif\">Respuesta:</span></span>\n	</div>\n	<div>\n<span style=\"font-size: 16.0px\"><span style=\"font-family: arial , helvetica , sans-serif\">S, 11 rodamientos de bolas de alto rendimiento, incluido 1 rodamiento de bolas antirretroceso 10 DE ACERO INOXIDABLE</span></span><span style=\"font-family: arial, helvetica, sans-serif;font-size: 16px\">Anti-corrosivo</span>\n	</div>\n	<div>\n<span style=\"font-size: 16.0px\"><span style=\"font-family: arial , helvetica , sans-serif\">Rodamientos de bolas!</span></span>\n	</div>\n	<div>\n<span style=\"font-size: 16.0px\"><span style=\"font-family: arial , helvetica , sans-serif\">Si no encuentras 11 rodamientos, djanos un mensaje y te ayudaremos a encontrar todos.</span></span>\n	</div>\n	<div>\n\n</div>\n	<div>\n<span style=\"font-size: 16.0px\"><span style=\"font-family: arial , helvetica , sans-serif\">Pregunta 3:</span></span>\n	</div>\n	<div>\n<span style=\"font-size: 16.0px\"><span style=\"font-family: arial , helvetica , sans-serif\">Cul es el material del cuerpo del carrete?</span></span>\n	</div>\n	<div>\n<span style=\"font-size: 16.0px\"><span style=\"font-family: arial , helvetica , sans-serif\">Respuesta:</span></span>\n	</div>\n	<div>\n<span style=\"font-size: 16.0px\"><span style=\"font-family: arial , helvetica , sans-serif\">El cuerpo del carrete es de material plstico pero fuerte.</span></span>\n	</div>\n	<div>\n\n</div>\n	<div>\n<span style=\"font-size: 16.0px\"><span style=\"font-family: arial , helvetica , sans-serif\">Pregunta 4:</span></span>\n	</div>\n	<div>\n<span style=\"font-size: 16.0px\"><span style=\"font-family: arial , helvetica , sans-serif\">Cul es el material del carrete?</span></span>\n	</div>\n	<div>\n<span style=\"font-size: 16.0px\"><span style=\"font-family: arial , helvetica , sans-serif\">Respuesta:</span></span>\n	</div>\n	<div>\n<span style=\"font-size: 16.0px\"><span style=\"font-family: arial , helvetica , sans-serif\">Carrete de aluminio mecanizado CNC.</span></span>\n	</div>\n	<div>\n\n</div>\n	<div>\n<span style=\"font-size: 16.0px\"><span style=\"font-family: arial , helvetica , sans-serif\">Pregunta 5:</span></span>\n	</div>\n	<div>\n<span style=\"font-size: 16.0px\"><span style=\"font-family: arial , helvetica , sans-serif\">Este carrete tiene interruptor inverso?</span></span>\n	</div>\n	<div>\n<span style=\"font-size: 16.0px\"><span style=\"font-family: arial , helvetica , sans-serif\">Respuesta:</span></span>\n	</div>\n	<div>\n<span style=\"font-size: 16.0px\"><span style=\"font-family: arial , helvetica , sans-serif\">S</span></span>\n	</div>\n	<div>\n\n</div>\n	<div>\n<span style=\"font-size: 16.0px\"><span style=\"font-family: arial , helvetica , sans-serif\">Pregunta 6:</span></span>\n	</div>\n	<div>\n<span style=\"font-size: 16.0px\"><span style=\"font-family: arial , helvetica , sans-serif\">Qu recibir tras la compra?</span></span>\n	</div>\n	<div>\n<span style=\"font-size: 16.0px\"><span style=\"font-family: arial , helvetica , sans-serif\">Respuesta:</span></span>\n	</div>\n	<div>\n<span style=\"font-size: 16.0px\"><span style=\"font-family: arial , helvetica , sans-serif\">1 carrete de pesca, 1 pieza X Instrucciones, 1 bolsa de carrete, embalaje Original, la caja est impresa con la estructura del producto y los parmetros del producto.</span></span>\n	</div>\n</div>\n<p>\n	&nbsp;\n</p>\n</div></div>\r\n<div class=\"detailmodule_dynamic\"></div>\r\n\n\n', 'SeaKnight-Carrete de pesca giratorio RAPID de 6,