(304, 1, '2020-12-05 17:03:54', '0000-00-00 00:00:00', '<div class=\"detailmodule_dynamic\"></div>\r\n<div class=\"detailmodule_html\"><div class=\"detail-desc-decorate-richtext\"><pre style=\"padding: 0px;margin: 0px;, sans-serif;font-size: 14px\">\n<span style=\"font-size: 22px\">Seaknight rpido II carrete de pesca de 6,2: 1 4,7: 1 10kg 11BB 2000H/2500H/3000H/4000H/5000H/6000 carrete giratorio para agua salada</span></pre>\n<div style=\"padding: 0px;margin: 0px;, sans-serif;font-size: 14px\">\n	&nbsp;\n</div>\n<div style=\"padding: 0px;margin: 0px;, sans-serif;font-size: 14px\">\n	<div style=\"padding: 0px;margin: 0px\">\n<div style=\"padding: 0px;margin: 0px;font-size: 13.3333px\">\n<span style=\"padding: 0px;margin: 0px;max-width: 100%\"><span style=\"padding: 0px;margin: 0px;font-weight: 700 !important\"><span style=\"padding: 0px;margin: 0px;max-width: 100%;font-family: verdana, geneva, sans-serif\"><span style=\"padding: 0px;margin: 0px;max-width: 100%;font-size: 14px\">Caractersticas:</span></span></span></span>\n</div>\n<div style=\"padding: 0px;margin: 0px;font-size: 13.3333px\">\n<div style=\"padding: 0px;margin: 0px\">\n<span style=\"padding: 0px;margin: 0px;max-width: 100%;font-size: 16px\">1. 1. Los rodamientos y componentes anticorrosivos permiten que el carrete se pueda utilizar tanto en agua dulce como en agua salada.</span>\n</div>\n<div style=\"padding: 0px;margin: 0px\">\n<span style=\"padding: 0px;margin: 0px;max-width: 100%;font-size: 16px\">2. 10 rodamientos de bolas de acero inoxidable + 1 rodamiento de bolas de acero inoxidable Anti-reversa proporcionan un funcionamiento suave.</span>\n</div>\n<div style=\"padding: 0px;margin: 0px\">\n<span style=\"padding: 0px;margin: 0px;max-width: 100%;font-size: 16px\">3. El diseo asimtrico actualizado del rotor puede lograr un funcionamiento ms ligero pero ms potente y ms suave.</span>\n</div>\n<div style=\"padding: 0px;margin: 0px\">\n<span style=\"padding: 0px;margin: 0px;max-width: 100%;font-size: 16px\">4. Carrete de aluminio CNC sper ligero.</span>\n</div>\n<div style=\"padding: 0px;margin: 0px\">\n<span style=\"padding: 0px;margin: 0px;max-width: 100%;font-size: 16px\">5. El sistema de arrastre de fibra de carbono proporciona un rendimiento de arrastre ms potente.</span>\n</div>\n</div>\n	</div>\n	<div style=\"padding: 0px;margin: 0px\">\n\n</div>\n	<div style=\"padding: 0px;margin: 0px\">\n<span style=\"padding: 0px;margin: 0px;font-weight: 700 !important;font-size: 12px\"><span style=\"padding: 0px;margin: 0px;max-width: 100%;font-family: verdana, geneva, sans-serif\"><span style=\"padding: 0px;margin: 0px;max-width: 100%;font-size: 14px\">Lista de paquetes:</span></span></span>\n	</div>\n	<div style=\"padding: 0px;margin: 0px\">\n<span style=\"padding: 0px;margin: 0px;max-width: 100%;font-family: verdana, geneva, sans-serif\">1 Pza * carrete de pesca;</span>\n	</div>\n	<div style=\"padding: 0px;margin: 0px\">\n<span style=\"padding: 0px;margin: 0px;max-width: 100%;font-family: verdana, geneva, sans-serif\">1 Pza * instrucciones;</span>\n	</div>\n	<div style=\"padding: 0px;margin: 0px\">\n<span style=\"padding: 0px;margin: 0px;max-width: 100%;font-family: verdana, geneva, sans-serif\">1 Pza * bolsa de carrete;</span>\n	</div>\n	<div style=\"padding: 0px;margin: 0px\">\n<span style=\"padding: 0px;margin: 0px;max-width: 100%;font-family: verdana, geneva, sans-serif\">Embalaje Original de la Caja</span>\n	</div>\n	<div style=\"padding: 0px;margin: 0px\">\n<span style=\"padding: 0px;margin: 0px;max-width: 100%;font-family: verdana, geneva, sans-serif\"><img alt=\"1\" src=\"https://ae01.alicdn.com/kf/He9354175f0cf43bab24d1996b84fd3fdE.png\" /></span>\n	</div>\n	<div style=\"padding: 0px;margin: 0px\">\n<span style=\"padding: 0px;margin: 0px;max-width: 100%;font-family: verdana, geneva, sans-serif\"><img alt=\"st_01\" src=\"https://ae01.alicdn.com/kf/H4eb5153df52c4df5960c23497c3c7001m.jpg\" /></span>\n	</div>\n	<div style=\"padding: 0px;margin: 0px\">\n<span sty