span>\n</div>\n<div style=\"padding: 0px;margin: 0px;font-size: 14px;text-align: left\">\n<span style=\"padding: 0px;margin: 0px;max-width: 100%;font-size: 16px\"><span style=\"padding: 0px;margin: 0px;max-width: 100%;font-family: arial, helvetica, sans-serif\">S</span></span>\n</div>\n<div style=\"padding: 0px;margin: 0px;font-size: 14px;text-align: left\">\n\n</div>\n<div style=\"padding: 0px;margin: 0px;font-size: 14px;text-align: left\">\n<span style=\"padding: 0px;margin: 0px;max-width: 100%;font-size: 16px\"><span style=\"padding: 0px;margin: 0px;max-width: 100%;font-family: arial, helvetica, sans-serif\">Pregunta 6:</span></span>\n</div>\n<div style=\"padding: 0px;margin: 0px;font-size: 14px;text-align: left\">\n<span style=\"padding: 0px;margin: 0px;max-width: 100%;font-size: 16px\"><span style=\"padding: 0px;margin: 0px;max-width: 100%;font-family: arial, helvetica, sans-serif\">Qu recibir despus de la compra?</span></span>\n</div>\n<div style=\"padding: 0px;margin: 0px;font-size: 14px;text-align: left\">\n<span style=\"padding: 0px;margin: 0px;max-width: 100%;font-size: 16px\"><span style=\"padding: 0px;margin: 0px;max-width: 100%;font-family: arial, helvetica, sans-serif\">Respuesta:</span></span>\n</div>\n<div style=\"padding: 0px;margin: 0px;font-size: 14px;text-align: left\">\n<span style=\"padding: 0px;margin: 0px;max-width: 100%;font-size: 16px\"><span style=\"padding: 0px;margin: 0px;max-width: 100%;font-family: arial, helvetica, sans-serif\">1 unidad * carrete de pesca; 1 unidad * instrucciones; 1 unidad * bolsa de carrete; Embalaje Original de la caja, la caja est impresa con la estructura del producto y los parmetros del producto.</span></span>\n</div>\n</div>\n</div>\n	</div>\n</div>\n<p>\n	&nbsp;\n</p>\n<p>\n	&nbsp;\n</p>\n</div></div>\r\n<div class=\"detailmodule_dynamic\"></div>\r\n\n\n', 'Seaknight Rapid II Serie Carrete de pesca 6.2: 1 4.7: 1 anticorrosin 10 kg 11BB 2000H / 2500H / 3000H / 4000H / 5000H / 6000 molinete de pesca hace girar e