(305, 1, '2020-12-05 17:03:54', '0000-00-00 00:00:00', '<div class=\"detailmodule_html\"><div class=\"detail-desc-decorate-richtext\"><div class=\"detailmodule_dynamic\">\n	<div>\n<div>\nCaracterstica\n</div>\n<div>\nAmpliamente utilizado: Una lmpara imprescindible para la mejora del hogar y la actividad al aire libre con 60W/190/240W y luz LED colgante de carga USB/Solar. Que se\n</div>\n<div>\nSu patio/jardn/patio/porche/jardn/barbacoa o puesto de calle negocios y mejorar su atmsfera al aire libre.\n</div>\n<div>\nTres modos: Esta bombilla LED recargable solar premium ajustar su brillo a sus necesidades especficas con 3 luces diferentes\n</div>\n<div>\nModos de Elija entre luz alta, luz baja, luz SOS para conocerle en cualquier momento y en cualquier lugar.\n</div>\n<div>\nPantalla de alimentacin y Control remoto: Hay 25%/50%/75%/100% luces indicadoras de batera restantes de cuatro velocidades, recordndote que cargues en cualquier\n</div>\n<div>\nTiempo! Interruptor de control remoto y modo de luz, muy prctico y prctico.\n</div>\n<div>\nAhorro de energa: es una lmpara a batera de 1200/ABS resistente mAH de 6400, que le proporciona luz uniforme a travs de constante\n</div>\n<div>\nFcil de llevar: fcilmente porttil, esta linterna con luz LED recargable solar te seguir sin tener que traer bateras\n</div>\n<div>\nEn todas partes hay un gran alivio!\n</div>\n<div>\n\n</div>\n<div>\nEspecificacin\n</div>\n<div>\nMaterial: aleacin de aluminio\n</div>\n<div>\nPotencia nominal: 60W/190W/240W\n</div>\n<div>\nCapacidad de la batera: 1200/5200/7200mAH\n</div>\n<div>\nModos de transformacin: luz alta/luz baja/luz SOS\n</div>\n<div>\nModelo de cuenta de lmpara: SMD5730\n</div>\n<div>\nColor luminoso: blanco-5000K\n</div>\n<div>\nResistencia al agua: IP65\n</div>\n<div>\nVida: &ge; 30000H\n</div>\n<div>\nngulo luminoso: 120 grados\n</div>\n<div>\nBATERA INTEGRADA: 2 uds. x18650 batera\n</div>\n<div>\nOcasin: trabajo, aprendizaje, fiesta, pesca, Camping, etc.\n</div>\n	</div>\n	<