(306, 1, '2020-12-05 17:03:54', '0000-00-00 00:00:00', '<div class=\"detailmodule_dynamic\"></div>\r\n<div class=\"detailmodule_media\"><div class=\"video-container-274284882672\"><div class=\"detail-video\" id=\"274284882672\" data-previewUrl=\"https://img.alicdn.com/imgextra/i3/6000000001520/O1CN01dcGVGC1N6CdRoxlnd_!!6000000001520-0-tbvideo.jpg\"></div></div></div>\r\n<div class=\"detailmodule_html\"><div class=\"detail-desc-decorate-richtext\"><div class=\"detailmodule_dynamic\">\n	<div style=\"text-align: center\">\n\n</div>\n</div>\n<div class=\"detailmodule_dynamic\">\n	\n</div>\n<div class=\"detailmodule_html\">\n	<div class=\"detail-desc-decorate-richtext\">\n<div>\n<div>\n<span style=\"font-size: 22.0px\"><span style=\"color: #00b0f0\"><strong>Hola mi amigo</strong></span></span>\n</div>\n<div>\n<span style=\"color: #000000\"><span style=\"font-size: 16.0px\">Soy Tim Soy el propietario de esta tienda.</span></span>\n</div>\n<div>\n<span style=\"color: #000000\"><span style=\"font-size: 16.0px\">Silla plegable al aire libre recin actualizada.</span></span>\n</div>\n<div>\n<span style=\"color: #000000\"><span style=\"font-size: 16.0px\">El producto se vender a costo este mes.</span></span>\n</div>\n<div>\n\n</div>\n<div>\n<span style=\"color: #000000\"><span style=\"font-size: 16.0px\">Ahora, me gustara presentaros a esta silla.</span></span>\n</div>\n<div>\n\n</div>\n<div>\n<strong><span style=\"color: #000000\"><span style=\"font-size: 16.0px\">Descripcin del producto</span></span></strong>\n</div>\n<div>\n<span style=\"color: #000000\"><span style=\"font-size: 16.0px\">Ultra Luz Porttil silla</span></span>\n</div>\n<div>\n<span style=\"color: #000000\"><span style=\"font-size: 16.0px\">Tamao de la unidad: 56*60,5*65,5 cm/juego</span></span>\n</div>\n<div>\n<span style=\"color: #000000\"><span style=\"font-size: 16.0px\">Puede abrirse rpidamente y peso ligero</span></span>\n</div>\n<div>\n<span style=\"color: #000000\"><span style=\"font-size: 16.0px\">Durable de marco de aluminio</span></span>\n</div>\n<div>\n<span style=\"color: #000000\"><span style=\"font-size: 16.0px\">Diseo ergonmico cmodo diseo</span></span>\n</div>\n<div>\n<span style=\"color: #000000\"><span style=\"font-size: 16.0px\">Puede soportar 150kg de carga en cada silla</span></span>\n</div>\n<div>\n<span style=\"color: #000000\"><span style=\"font-size: 16.0px\">Polister 600D con malla transpirable y revestimiento de PE resistente al agua</span></span>\n</div>\n<div>\n\n</div>\n<div>\n<span style=\"color: #000000\"><span style=\"font-size: 16.0px\">El diseo ligero solo pesa 0,9 kg</span></span>\n</div>\n<div>\n<span style=\"color: #000000\"><span style=\"font-size: 16.0px\">Polister 600D con revestimiento de PVC resistente al agua</span></span>\n</div>\n<div>\n<span style=\"color: #000000\"><span style=\"font-size: 16.0px\">Secciones de malla transpirable para una mayor comodidad</span></span>\n</div>\n<div>\n<span style=\"color: #000000\"><span style=\"font-size: 16.0px\">Marco de aluminio ligero y duradero</span></span>\n</div>\n<div>\n<span style=\"color: #000000\"><span style=\"font-size: 16.0px\">El marco consiste en postes elsticos auto-unidos</span></span>\n</div>\n<div>\n<span style=\"color: #000000\"><span style=\"font-size: 16.0px\">Agitar el marco y los postes hacer clic automticamente junto incluye la bolsa para un fcil almacenamiento y transporte</span></span>\n</div>\n<div>\n<span style=\"color: #000000\"><span style=\"font-size: 16.0px\">La bolsa cuenta con cierre de cremallera y asa de transporte</span></span>\n</div>\n<div>\n<span style=\"color: #000000\"><span style=\"font-size: 16.0px\">Capacidad mxima de peso: 150 kg/set</span></span>\n</div>\n<div>\n<span style=\"color: #000000\"><span style=\"font-size: 16.0px\">Tamao en bolsa (cm):35*11cm/juego</span></span>\n</div>\n<div>\n\n</div>\n<div>\n<span style=\"color: #000000\"><span style=\"font-size: 16.0px\">1 * silla plegable</span></span>\n</div>\n<div>\n<span style=\"color: #000000\"><span style=\"font-size: 16.0px\">1 * bolsa de almacenamiento</span></span>\n</div>\n</div>\n<p style=\"text-align: center\">\n\n</p>\n<p style=\"text-align: center\">\n<img alt=\"_22\" src=\"https://ae01.alicdn.com/kf/HTB1TysbRCzqK1RjSZPxq6A4tVXa4.jpg\" /><img alt=\"_21\" src=\"https://ae01.alicdn.com/kf/HTB19a.nRAPoK1RjSZKbq6x1IXXab.jpg\" />\n</p>\n<p style=\"text-align: center\">\n\n</p>\n<p style=\"text-align: center\">\n<strong><span><span style=\"font-size: 26px\">Opiniones reales de los clientes</span></span></strong>\n</p>\n<p style=\"text-align: center\">\n<strong><span><span style=\"font-size: 26px\"><img alt=\"9(1)\" src=\"https://ae01.alicdn.com/kf/HTB1k6pBbUGF3KVjSZFoq6zmpFXaF.jpg\" /></span></span></strong>\n</p>\n<p style=\"text-align: center\">\n<img alt=\"1017\" src=\"https://ae01.alicdn.com/kf/HTB1yyl1XBGw3KVjSZFDq6xWEpXab.jpg\" /><img alt=\"6\" src=\"https://ae01.alicdn.com/kf/HTB18QaDX9SD3KVjSZFKq6z10VXaK.jpg\" />\n</p>\n<p style=\"text-align: center\">\n<img alt=\"_01\" src=\"https://ae01.alicdn.com/kf/HTB1_Eg5X5jrK1RjSsplq6xHmVXaO.jpg\" />\n</p>\n<p style=\"text-align: center\">\n<span><em><strong><span style=\"font-size: 26px\">Flash Deal ~ 3 de septiembre al 6 de septiembre.</span></strong></em></span>\n</p>\n<p style=\"text-align: center\">\n<span><span style=\"font-size: 36px\"><em><strong>Precio Ms favorable!</strong></em></span></span><a href=\"https://www.aliexpress.com/item/1005001381639794.html?spm=5261.ProductManageOnline.0.0.57464edfwVFCHc\"><img alt=\"2\" src=\"https://ae01.alicdn.com/kf/H587946de65a4465c88c230004be8397bl.jpg\" /></a>\n</p>\n<p style=\"text-align: center\">\n<img alt=\"_02\" src=\"https://ae01.alicdn.com/kf/HTB14lrBt3HqK1RjSZFPq6AwapXaB.jpg\" /><img alt=\"_03\" src=\"https://ae01.alicdn.com/kf/HTB19tU4X5zxK1RkSnaVq6xn9VXaj.jpg\" /><img alt=\"_05\" src=\"https://ae01.alicdn.com/kf/HTB164M1X16sK1RjSsrbq6xbDXXaI.jpg\" />\n</p>\n<div style=\"text-align: center\">\n\n</div>\n<div style=\"text-align: center\">\n<st