   </li>\n							                    </ul>\n                </div>\n				<div class=\"detailmodule_dynamic\"></div>\n<div class=\"detailmodule_text-image\"><p class=\"detail-desc-decorate-title\" style=\"font-family: \'OpenSans\';color:\'#000\';font-weight: 900;font-size: 20px;line-height: 28px;color: #000;margin-bottom: 12px\">Kingdom KING PRO caa de pescar de fundicin caas de pescar de dos secciones punta superior 2pc o mltiples secciones caas de pescar caa de viaje de alta calidad</p><p class=\"detail-desc-decorate-content\" style=\"font-family: \'OpenSans\';color:\'#000\';font-weight: 300;font-size: 14px;line-height: 20px;color: #000;margin-bottom: 12px\">Esta es una varilla que tienes que ver para creer. Usted obtiene el rendimiento y la durabilidad que desea de las marcas de su confianza. Qu ms puedes pedir? Solo aqu en KINGDOM!\n\nKING PRO diseado para pescadores de Cabeza de Acero graves, esta caa combina funcin, estilo y precio asequible. Esta barra de tallarines de accin ligera utiliza una construccin en blanco de grafito 100% y un mango de madera, para que puedas sentir cada tierna mordaza. La varilla larga y flexible debe combinarse con una lnea de luz, para que puedas crear exposiciones muy delicadas para salmn y estelias. Tambin puedes dirigirte al Walleye, al Panfish y a los lubina con esta caa. Es la opcin ideal para flotar o hundir la pesca. Esta caa de pescar est diseada para satisfacer las demandas de los pescadores de cabeza de acero de los Grandes Lagos y cuenta con guas de xido de aluminio y un mango de primera calidad, por lo que es un valor increble.\nLa varilla de 2 secciones tiene dos puntas y dos potencia diferente\nVarillas de mltiples secciones una punta y una potencia\nMango de madera (hecho de madera natural)\n100% de grafito en construccin\nSensible Punta de accin\nDe xido de aluminio guas\nPremium agarre\nAsiento de carrete japons de alta calidad\nConstruccin de frula de punta sobre tope\nVentajas: buena accin de la punta\nDe alta sensibilidad\nLuz\nDurable</p><img src=\"//ae01.alicdn.com/kf/H84e17a274ae248e681c3d5f6e1194d7bn.jpg\" class=\"detail-desc-decorate-image\"><img src=\"//ae01.alicdn.com/kf/H96b75683a28340d0bf9a5d5182e7d23aV.jpg\" class=\"detail-desc-decorate-image\"><img src=\"//ae01.alicdn.com/kf/Hfad843b9958342d6bbaa49dd74d509beO.jpg\" class=\"detail-desc-decorate-image\"><img src=\"//ae01.alicdn.com/kf/H1aec740b04264d94b83713c76bb1dd86b.jpg\" class=\"detail-desc-decorate-image\"><img src=\"//ae01.alicdn.com/kf/Hf9fc9bd21435489b92d51bb69d26b52ea.jpg\" class=\"detail-desc-decorate-image\"><img src=\"//ae01.alicdn.com/kf/H8486c8d13a674979b5ee034700fa49369.jpg\" class=\"detail-desc-decorate-image\"><img src=\"//ae01.alicdn.com/kf/Hf5446fa573414523925657a2bcded430Y.jpg\" class=\"detail-desc-decorate-image\"><img src=\"//ae01.alicdn.com/kf/H999aaf3346dd466487f29c06a6400648a.jpg\" class=\"detail-desc-decorate-image\"><img src=\"//ae01.alicdn.com/kf/H591f8d00076447509227fba4a7a18661c.jpg\" class=\"detail-desc-decorate-image\"><img src=\"//ae01.alicdn.com/kf/H415bc870b77c4a119ac9088ac98a4c3dh.jpg\" class=\"detail-desc-decorate-image\"><img src=\"//ae01.alicdn.com/kf/H7da8d93bf54d488c89c19e825d80428c1.jpg\" class=\"detail-desc-decorate-image\"><img src=\"//ae01.alicdn.com/kf/Hb297b6638e744fc99396052fb77963e4C.jpg\" class=\"detail-desc-decorate-image\"><img src=\"//ae01.alicdn.com/kf/H8fe32066994c45cf87eb8a0513196a8dP.jpg\" class=\"detail-desc-decorate-image\"><img src=\"//ae01.alicdn.com/kf/H512a7ee0d67a4ec494933718c6297084b.jpg\" class=\"detail-desc-decorate-image\"><img src=\"//ae01.alicdn.com/kf/H7dda0b612f8647618963789376a71f76N.jpg\" class=\"detail-desc-decorate-image\"><img src=\"//ae01.alicdn.com/kf/H195261466b26444392f34de54091879aR.jpg\" class=\"detail-desc-decorate-image\"><img src=\"//ae01.alicdn.com/kf/H27f1589115d94dea8f494d56f6d99497m.jpg\" class=\"detail-desc-decorate-image\"><img src=\"//ae01.alicdn.com/kf/Hbf8a7eae97574dd9b7c541529b0f93ae3.jpg\" class=\"detail-desc-decorate-i