(338, 1, '2020-12-07 14:32:18', '2020-12-07 14:32:18', '<div class=\"detailmodule_dynamic\"></div>\n<div class=\"detailmodule_html\"><div class=\"detail-desc-decorate-richtext\"> \n<p> <span style=\"font-size: 22.0px\"><span style=\"font-family: arial , helvetica , sans-serif\">SeaKnight PUCK 2000 3000 4000 5000 carrete de pesca giratorio 9KG arrastre mximo 10BB 5,2: 1 bobina para pesca de carpa ultraligera de aluminio</span></span></p> \n<div> \n <span style=\"color: #ff0000\"><strong><span style=\"font-size: 14.0px\"><span style=\"font-family: verdana , geneva , sans-serif\">Caracterstica:</span></span></strong></span> \n</div> \n<div> \n <span style=\"font-size: 14.0px\"><span style=\"font-family: verdana , geneva , sans-serif\">1. Cuerpo de plstico de alta resistencia</span></span> \n</div> \n<div> \n <span style=\"font-size: 14.0px\"><span style=\"font-family: verdana , geneva , sans-serif\">2. Sistema de embrague unidireccional</span></span> \n</div> \n<div> \n <span style=\"font-size: 14.0px\"><span style=\"font-family: verdana , geneva , sans-serif\">3. Excelente fundicin y colocacin en lnea</span></span> \n</div> \n<div> \n <span style=\"font-size: 14.0px\"><span style=\"font-family: verdana , geneva , sans-serif\">4. Ajuste de arrastre de clic micrnico</span></span> \n</div> \n<div> \n <span style=\"font-size: 14.0px\"><span style=\"font-family: verdana , geneva , sans-serif\">5. Carrete de aluminio ultraligero con alta resistencia</span></span> \n</div> \n<div>\n\n</div> \n<div> \n <strong><span style=\"font-size: 14.0px\"><span style=\"font-family: verdana , geneva , sans-serif\">Detalles del producto:</span></span></strong> \n</div> \n<div> \n <span style=\"font-size: 14.0px\"><span style=\"font-family: verdana , geneva , sans-serif\">PUCK2000 | Peso: 252g | Relacin de engranajes: 5,2: 1 | Rodamiento: 10BB | Arrastre mximo: capacidad de lnea KG | 5,5 (mm-M): 0,18-370; 0,20-300</span></span> \n</div> \n<div> \n <span style=\"font-size: 14.0px\"><span style=\"font-family: verdana , geneva , sans-serif\">PUCK3000 | Peso: 265g | Relacin de engranajes: 5,2: 1 | Rodamiento: 10BB | Arrastre mximo: capacidad de lnea KG | 6,0 (mm-M): 0,25-270; 0,30-180</span></span> \n</div> \n<div> \n <span style=\"font-size: 14.0px\"><span style=\"font-family: verdana , geneva , sans-serif\">PUCK4000 | Peso: 353g | Relacin de engranajes: 5,2: 1 | Rodamiento: 10BB | Arrastre mximo: 8,5 KG | Capacidad de lnea (mm-m): 0,35-160; 0,40-120</span></span> \n</div> \n<div> \n <span style=\"font-size: 14.0px\"><span style=\"font-family: verdana , geneva , sans-serif\">PUCK5000 | Peso: 387g | Relacin de engranajes: 5,2: 1 | Rodamiento: 10BB | Arrastre mximo: 9,0 KG | Capacidad de lnea (mm-m): 0,40-150; 0,50-100</span></span> \n</div> \n<div>\n\n</div> \n<div> \n <span style=\"font-family: verdana , geneva , sans-serif\"><span style=\"font-size: 14.0px\"><strong>Embalaje</strong>:</span></span> \n</div> \n<div> \n <span style=\"font-family: verdana , geneva , sans-serif\"><span style=\"font-size: 14.0px\">1 carrete de pesca giratorio</span></span> \n</div> \n<div>\n\n</div> \n<div> \n <img alt=\"_01\" src=\"https://ae01.alicdn.com/kf/HTB19G2CflnTBKNjSZPfq6zf1XXag.jpg\" /> \n <img alt=\"_03\" src=\"https://ae01.alicdn.com/kf/HTB1FD6Rqv5TBuNjSspmq6yDRVXaW.jpg\" /> \n <img alt=\"_04\" src=\"https://ae01.alicdn.com/kf/HTB12yrbfcUrBKNjSZPxq6x00pXaE.jpg\" /> \n <img alt=\"_06\" src=\"https://ae01.alicdn.com/kf/HTB1e3DgqrGYBuNjy0Foq6AiBFXa0.jpg\" /> \n <img alt=\"_07\" src=\"https://ae01.alicdn.com/kf/HTB1hI1DindYBeNkSmLyq6xfnVXa0.jpg\" /> \n <img alt=\"_08\" src=\"https://ae01.alicdn.com/kf/HTB15eg0fiQnBKNjSZFmq6AApVXax.jpg\" /> \n <img alt=\"_10\" src=\"https://ae01.alicdn.com/kf/HTB1WvinaoD.BuNjt_ioq6AKEFXah.jpg\" /> \n <img alt=\"_11\" src=\"https://ae01.alicdn.com/kf/HTB1Dew0fiQnBKNjSZFmq6AApVXaR.jpg\" /> \n <img alt=\"_12\" src=\"https://ae01.alicdn.com/kf/HTB1Js2dquuSBuNjSsplq6ze8pXaJ.jpg\" /> \n <img alt=\"_13\" src=\"https://ae01.alicdn.com/kf/HTB